import React, { useState } from 'react';
import Note from './Note';
import AddNote from './AddNote';

const NotesList = ({
    notes,
    handleAddNote,
    handleDeleteNote,
    handleStartEditingNote,
    editNoteId,
    editedNoteText,
    handleFinishEditingNote,
}) => {
    return (
        <div className='notes-list'>
            {notes.map((note) => (
                <Note
                    key={note.id}
                    id={note.id}
                    text={note.text}
                    date={note.date}
                    handleDeleteNote={handleDeleteNote}
                    handleStartEditingNote={handleStartEditingNote}
                    isEditing={editNoteId === note.id}
                    editedNoteText={editedNoteText}
                    handleFinishEditingNote={handleFinishEditingNote}
                />
            ))}
            <AddNote handleAddNote={handleAddNote} />
        </div>
    );
};

export default NotesList;
